import Block from '../Block';
export default class RawHtml extends Block {
    getType() {
        return 'raw-html';
    }
    getEmptyData() {
        return {
            text: ''
        };
    }
    isDataValid(data) {
        var keys = Object.keys(data);
        return keys.length === 1 && !_.isNil(data.text);
    }
    getEmptyConfig() {
        return {};
    }
    mergeData(dest, src) {
        if (!_.isNil(src.text)) {
            dest.text = src.text;
        }
    }
}